                                <Content_fourth values={this.state.values} />
                            </div>
                        </div>
                        <div className='middle' >
                            <div className='contentfifth'>
                                <DataUplode />
                            </div>
                        </div>
                    </Content>
                </form>
                <Footer className='footer'>
                    <ReasultShow />
                </Footer>
            </Layout>
        )
    }
}

